import Footer from "./components/Footer.jsx";
import NavBar from "./Navbar.jsx";
import Welcome from"./Welcom.jsx";
import FindOwner from "./FindOwner.jsx"
import Verter from "./Veter.jsx";
import AddOwner from "./AddOwner.jsx";
import Resalt from "./Resalt.jsx";
import Update from "./UpdateOwner.jsx";
import AddAnimal from "./AddPet.jsx";
import OwnerList from "./OwnerList.jsx";
import OwnerInfo from "./OwnerInfo.jsx";
import UpDatePet from "./UpDatePet.jsx";
import VisitPet from "./VisitPet.jsx";
import AddPet from "./AddPet.jsx";
import UpdateOwner from "./UpdateOwner.jsx";
import {RouterProvider, createBrowserRouter} from "react-router-dom";


function App() {
    const route = createBrowserRouter([
        {
        path:"/",
        element:<Welcome/>
        },
        {
            path:"/Home",
            element:<Welcome/>
        },
        {
            path:"/FindOwners",
            element:<FindOwner/>
        },
        {
            path:"/VETERINARIANS",
            element:<Verter/>
        },
        {
            path:"/AddOwner",
            element:<AddOwner/>
        },
        {
            path:"/FindOwner",
            element:<OwnerInfo/>
        },
        {
            path:"/UpdateOwner",
            element:<UpdateOwner/>
        },
        {
            path:"/AddPet",
            element:<AddPet/>
        },
        {
            path:"/AddVisit",
            element:<VisitPet/>
        },
        {
            path:"/UpdatePet",
            element:<UpDatePet/>
        },
        {
            path:"/OwnerInfo",
            element:<OwnerInfo/>
        },
        {
            path:"/Result",
            element:<Resalt/>
        },

    ])


    return (

    <div className="App">
        <RouterProvider router={route}></RouterProvider>
    </div>




);

}

export default App
